import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";
import axios from "axios";

const apiURL = process.env.SEND_EMAIL;
// ログイン時処理
export const fetchAsyncSendEmail = createAsyncThunk("/send_email", async () => {
  console.log(apiURL);
  const res = await axios.get(`${apiURL}`);
  return res.data;
});

